import React from 'react';
import './Header.css';

function Header () {

	var reak = "{ REACT }";
	var imagen = "https://ouch-cdn2.icons8.com/GcfbRzbpV46ApbM94z6RGZPvj1niXNehLBUfq9QRg7Y/rs:fit:542:456/czM6Ly9pY29uczgu/b3VjaC1wcm9kLmFz/c2V0cy9zdmcvNjIv/ZWY4M2QxMTQtYzA2/Ni00NzgzLWE2MTUt/YzVkMDNjNTUzZDU5/LnN2Zw.png";
	
	const test = () => {
		var mensaje = prompt( "algo" );
		if ( mensaje === null ) {
			mensaje = reak.replaceAll( "{" , "" ).replaceAll( "}" , "" );
			document.querySelector( ".eljeader" ).innerHTML = ( `PRACTICE - {${ mensaje }}` );
		} else if ( mensaje === "" ) {
			mensaje = reak.replaceAll( "{" , "" ).replaceAll( "}" , "" );
			document.querySelector( ".eljeader" ).innerHTML = ( `PRACTICE - {${ mensaje }}` );
		} else {
			document.querySelector( ".eljeader" ).innerHTML = ( `PRACTICE - {${ mensaje }}` );
		};
	};
	
	return (
		<header>
			<img style="width: '100px'" src={ imagen } alt="CODE" />
			<h1 className="eljeader" onClick={test}>PRACTICE - {reak}</h1>
		</header>
	);
}

export default Header;
